import React, { Component } from "react";
import { Link }from "react-scroll";

 class Navbar extends Component {
   state = {};
  render() {
    return (
     
      <div className="Navbar">
      <ul>
    <Link
    activeClass="active"
    to="Home"
    spy={true}
    smooth={true}
    offset={-70}
    duration={500}
>Home</Link>

<Link
    activeClass="active"
    to="Service"
    spy={true}
    smooth={true}
    offset={-70}
    duration={500}
>service</Link>
</ul>
</div>
  );
  }
}
export default Navbar ;
